        private static List<WoWPoint> GetPointsByBuildingId(int buildingId)
        {
            switch (buildingId)
            {
                case (int) Buildings.AlchemyLabLvl1:
                case (int) Buildings.AlchemyLabLvl2:
                case (int)Buildings.AlchemyLabLvl3:
                    return Me.IsAlliance ? GetSmallBuildingAlliance() : GetSmallBuildingHorde();

                case (int) Buildings.BarnLvl1:
                case (int) Buildings.BarnLvl2:
                case (int) Buildings.BarnLvl3:
                    // HEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEEERE
                    return Me.IsAlliance ? GetBarnHorde() : GetBarnHorde();

                case (int) Buildings.BarracksLvl1:
                case (int) Buildings.BarracksLvl2:
                case (int) Buildings.BarracksLvl3:
